--
-- Name: analysis_summary; Type: VIEW; Schema: public; Owner: cgallego
--

CREATE VIEW public.analysis_summary AS
 SELECT va.id,
    va.video_path,
    va.model_name,
    va.status,
    va.total_frames,
    va.fps,
    va.resolution_width,
    va.resolution_height,
    va.started_at,
    va.completed_at,
    count(DISTINCT fd.track_id) AS unique_tracks,
    count(fd.id) AS total_detections,
    count(ze.id) AS total_zone_events,
    count(lce.id) AS total_line_crossings
   FROM (((public.video_analyses va
     LEFT JOIN public.frame_detections fd ON ((va.id = fd.video_analysis_id)))
     LEFT JOIN public.zone_events ze ON ((va.id = ze.video_analysis_id)))
     LEFT JOIN public.line_crossing_events lce ON ((va.id = lce.video_analysis_id)))
  GROUP BY va.id, va.video_path, va.model_name, va.status, va.total_frames, va.fps, va.resolution_width, va.resolution_height, va.started_at, va.completed_at;


