CREATE VIEW public.unique_tracks_per_analysis AS
 SELECT frame_detections.video_analysis_id,
    frame_detections.track_id,
    min(frame_detections.timestamp_ms) AS first_seen,
    max(frame_detections.timestamp_ms) AS last_seen,
    count(*) AS total_frames,
    min((frame_detections.class_name)::text) AS class_name
   FROM public.frame_detections
  GROUP BY frame_detections.video_analysis_id, frame_detections.track_id;


